import React, { useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
import universityData from "./UniversityData";
import "./App.css";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState("");
  const [selectedSubject, setSelectedSubject] = useState("");
  const [studentType, setStudentType] = useState("International");
  const [cgpa, setCgpa] = useState("");
  const [sat, setSat] = useState("");

  const handleUniversityChange = (e) => {
    setSelectedUniversity(e.target.value);
    setSelectedSubject("");
  };

  const selectedUniversityData = universityData.find(
    (u) => u.name === selectedUniversity
  );

  const selectedSubjectData =
    selectedUniversityData?.subjects?.find((s) => s.name === selectedSubject) || null;

  const eligibilityInfo =
    selectedSubjectData?.eligibility?.[studentType] || "Not Available";
  const fees = selectedSubjectData?.fees || "Not Available";
  const startDate = selectedSubjectData?.startDate || "Not Available";
  const scholarship = selectedSubjectData?.scholarship || "Not Available";
  const intakes = selectedSubjectData?.intakes || "Not Available";
  const deadlines = selectedSubjectData?.applicationDeadlines || "Not Available";
  const courseLink = selectedSubjectData?.courseLink || "Not Available";

  let admissionChance = "";
  if (cgpa && sat) {
    const gpaCutoff = selectedSubjectData?.gpaCutoff || 0;
    const satCutoff = selectedSubjectData?.satCutoff || 0;
    if (cgpa >= gpaCutoff && sat >= satCutoff) {
      admissionChance = "High";
    } else if (cgpa >= gpaCutoff || sat >= satCutoff) {
      admissionChance = "Medium";
    } else {
      admissionChance = "Low";
    }
  }

  const rankings = selectedSubjectData?.rankings || [];

  return (
    <div className="App" style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>QS World University Rankings Explorer</h1>

      <label>Select University: </label>
      <select value={selectedUniversity} onChange={handleUniversityChange}>
        <option value="">--Select--</option>
        {universityData.map((uni) => (
          <option key={uni.name} value={uni.name}>
            {uni.name}
          </option>
        ))}
      </select>

      <div style={{ marginTop: "10px" }}>
        <label>Student Type:</label>
        <button
          onClick={() => setStudentType("International")}
          style={{
            marginLeft: "10px",
            backgroundColor: studentType === "International" ? "lightblue" : "",
          }}
        >
          International
        </button>
        <button
          onClick={() => setStudentType("Domestic")}
          style={{
            marginLeft: "5px",
            backgroundColor: studentType === "Domestic" ? "lightblue" : "",
          }}
        >
          Domestic
        </button>
      </div>

      {selectedUniversity && (
        <>
          <h2>{selectedUniversity}</h2>
          <p>
            <strong>General QS Rank:</strong>{" "}
            {selectedUniversityData?.generalQSRank || "Not Available"}
          </p>

          <label>Select Subject: </label>
          <select
            value={selectedSubject}
            onChange={(e) => setSelectedSubject(e.target.value)}
          >
            <option value="">--Select Subject--</option>
            {selectedUniversityData?.subjects?.map((s) => (
              <option key={s.name} value={s.name}>
                {s.name}
              </option>
            ))}
          </select>
        </>
      )}

      {selectedSubject && selectedSubjectData && (
        <>
          <h2>{selectedSubject}</h2>
          <p>
            <strong>QS Subject Rank:</strong>{" "}
            {rankings?.[rankings.length - 1]?.qsRank || "Not Available"}
          </p>
          <p><strong>Start Date:</strong> {startDate}</p>
          <p><strong>Fees:</strong> {fees}</p>
          <p><strong>Eligibility:</strong> {eligibilityInfo}</p>
          <p><strong>Intakes per Year:</strong> {intakes}</p>
          <p><strong>Application Deadlines:</strong> {deadlines}</p>
          <p><strong>Scholarship Info:</strong> {scholarship}</p>
          <p><strong>Course Link:</strong> {courseLink}</p>

          <h3>Student Inputs</h3>
          <label>Enter CGPA (out of 10): </label>
          <input
            type="number"
            value={cgpa}
            onChange={(e) => setCgpa(parseFloat(e.target.value))}
            step="0.1"
          />
          <br />
          <label>Enter SAT Score: </label>
          <input
            type="number"
            value={sat}
            onChange={(e) => setSat(parseInt(e.target.value))}
          />
          <br />
          {cgpa && sat && (
            <p>
              <strong>Admission Probability:</strong> {admissionChance}
            </p>
          )}

          <h3>QS Rankings (Last 5 Years)</h3>
          {rankings?.length > 0 ? (
            <>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={rankings}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="year" />
                  <YAxis domain={[0, 100]} reversed tickCount={10} />
                  <Tooltip />
                  <Legend />
                  <Line
                    type="monotone"
                    dataKey="qsRank"
                    stroke="#8884d8"
                    name="QS Rank"
                  />
                  <Line
                    type="monotone"
                    dataKey="gpaCutoff"
                    stroke="#82ca9d"
                    name="GPA Cutoff"
                  />
                  <Line
                    type="monotone"
                    dataKey="satCutoff"
                    stroke="#ffc658"
                    name="SAT Cutoff"
                  />
                </LineChart>
              </ResponsiveContainer>

              <table border="1" cellPadding="5" style={{ marginTop: "20px" }}>
                <thead>
                  <tr>
                    <th>Year</th>
                    <th>QS Rank</th>
                    <th>GPA Cutoff</th>
                    <th>SAT Cutoff</th>
                  </tr>
                </thead>
                <tbody>
                  {rankings.map((r, index) => (
                    <tr key={index}>
                      <td>{r.year}</td>
                      <td>{r.qsRank}</td>
                      <td>{r.gpaCutoff}</td>
                      <td>{r.satCutoff}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </>
          ) : (
            <p>No ranking data available.</p>
          )}
        </>
      )}
    </div>
  );
}

